-- ----------------------------
DROP TABLE IF EXISTS `gt_audit`;
CREATE TABLE `gt_audit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `basicinfo` text COMMENT '基础信息',
  `ticket` text COMMENT '商票信息',
  `trade` text COMMENT '贸易',
  `warrenttype` text COMMENT '担保方式',
  `paydemand` text COMMENT '出款要求',
  `contractinfo` text COMMENT '合同文本',
  `pro_id` int(11) DEFAULT NULL COMMENT '项目id',
  `auditresult` enum('2','0','1') NOT NULL DEFAULT '0' COMMENT '1,通过,2未通过',
  `illustration` varchar(256) DEFAULT NULL COMMENT '说明',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=113 DEFAULT CHARSET=utf8 COMMENT='内审详情';

