DROP TABLE IF EXISTS `gt_auto_finance`;
CREATE TABLE `gt_auto_finance` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `mid` int(10) unsigned NOT NULL COMMENT '会员单位',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否执行成功',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

