-- ----------------------------
-- Table structure for gt_backlog
-- ----------------------------
DROP TABLE IF EXISTS `gt_backlog`;
CREATE TABLE `gt_backlog` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `admin_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '通知后台特定用户',
  `role_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '通知后台特定角色用户',
  `controller` varchar(32) NOT NULL DEFAULT '' COMMENT '控制器',
  `action` varchar(32) NOT NULL DEFAULT '' COMMENT '动作',
  `description` varchar(256) NOT NULL DEFAULT '' COMMENT '待办事项描述',
  `title` varchar(64) NOT NULL DEFAULT '' COMMENT '标题',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `pro_id` int(10) unsigned NOT NULL DEFAULT '0',
  `step_pid` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `step_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=432 DEFAULT CHARSET=utf8;

