  `receive_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '收票时间',
  `out_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '出票时间',
  `due_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '到期时间',
  `num` varchar(40) CHARACTER SET latin1 NOT NULL DEFAULT '' COMMENT '票据号码',
  `out_company_id` mediumint(5) unsigned NOT NULL DEFAULT '0' COMMENT '出票人',
  `recevier_company_id` mediumint(5) unsigned NOT NULL DEFAULT '0' COMMENT '收款人',
