DROP TABLE IF EXISTS `gt_finance_flow`;
CREATE TABLE `gt_finance_flow` (
  `fid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `money` decimal(12,2) NOT NULL COMMENT '资金',
  `type` enum('in','out') NOT NULL COMMENT '流水类型',
  `remark` varchar(256) NOT NULL DEFAULT '' COMMENT '备注',
  `bank_id` tinyint(3) unsigned NOT NULL COMMENT '保理银行id',
  `addtime` int(10) unsigned NOT NULL COMMENT '新增时间',
  `pay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '具体打款时间',
  `has_distribute` decimal(12,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '已经分配认领的金额',
  `counterparty` varchar(32) NOT NULL DEFAULT '' COMMENT '交易对手',
  `admin_id` int(10) unsigned NOT NULL DEFAULT '0',
  `is_exchange` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否换质',
  `pro_id` int(3) DEFAULT '0' COMMENT '绑定项目ID（0是未绑定）',
  `wf_id` int(3) DEFAULT NULL COMMENT '绑定其他流程的id :比如换质退票 换质退款等等',
  PRIMARY KEY (`fid`)
) ENGINE=InnoDB AUTO_INCREMENT=53 DEFAULT CHARSET=utf8;

