  `cash_deposit_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '保证金状态0未给，1已付对方，2收回',
  PRIMARY KEY (`oid`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8;

