-- ----------------------------
-- Table structure for gt_fund_order_log
-- ----------------------------
DROP TABLE IF EXISTS `gt_fund_order_log`;
CREATE TABLE `gt_fund_order_log` (
  `log_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `fund_id` int(10) unsigned NOT NULL,
  `fmanager_id` mediumint(5) unsigned NOT NULL DEFAULT '0' COMMENT '客户经理id',
  `money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `customer_name` varchar(16) NOT NULL DEFAULT '' COMMENT '客户姓名',
  `pay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '客户打款时间',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `contract_no` varchar(32) NOT NULL DEFAULT '' COMMENT '合同号',
  `partnership` varchar(32) NOT NULL DEFAULT '' COMMENT '合伙企业',
  `begin_interest_time` int(10) NOT NULL DEFAULT '0' COMMENT '起息时间',
  `done_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '成立时间',
  `fund_title` varchar(32) NOT NULL DEFAULT '' COMMENT '项目',
  `fund_rate` float(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '客户收益率',
  `term` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '期限',
  `deadline` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '到期时间',
  `id_no` varchar(20) NOT NULL DEFAULT '' COMMENT '身份证号',
  `bank_no` varchar(32) NOT NULL DEFAULT '' COMMENT '银行账号',
  `link_type` varchar(32) NOT NULL DEFAULT '' COMMENT '联系方式',
  `performance_rate` float(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '业绩提成率',
  `manage_rate` float(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '管理津贴率',
  `changer_id` int(5) unsigned NOT NULL DEFAULT '0' COMMENT '修改人的id',
  `remark` text COMMENT '备注',
  `interestDue` decimal(12,4) NOT NULL DEFAULT '0.0000' COMMENT '到期本息',
  `accruaType` int(1) NOT NULL COMMENT '付息类型：1是季付，2是半年付，3是年付，4是备注模式',
  `time_to_rate` text COMMENT '时间对应利率',
  `file_path` varchar(255) DEFAULT NULL COMMENT '上传图片路径',
  `fmanager_name` char(50) DEFAULT '' COMMENT '客户经理姓名',
  `fmanager_area` char(50) DEFAULT '' COMMENT '客户经理地区',
  `fmanager_branch` char(50) DEFAULT '' COMMENT '客户经理分部',
  PRIMARY KEY (`log_id`)
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_fund_order_log
-- ----------------------------

-- ----------------------------
-- Table structure for gt_loan_form
-- ----------------------------
DROP TABLE IF EXISTS `gt_loan_form`;
CREATE TABLE `gt_loan_form` (
  `loan_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `contract_id` int(10) unsigned NOT NULL,
  `pro_id` int(10) unsigned NOT NULL,
  `company_id` int(10) unsigned NOT NULL,
  `money` decimal(12,2) unsigned NOT NULL COMMENT '实际放款金额',
  `assure_type` varchar(16) NOT NULL DEFAULT '',
  `pay_type` varchar(8) NOT NULL DEFAULT '',
  `loan_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0换质1融资',
  `is_supervision` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否监管',
  `handling_charge_bank_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `counseling_fee_bank_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `repurchase_rate_bank_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `cash_deposit_bank_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `desciption` varchar(1024) NOT NULL DEFAULT '',
  `submit_status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `receive_name` varchar(32) NOT NULL,
  `recevie_bank` varchar(32) NOT NULL,
  `recevie_bank_no` varchar(32) NOT NULL,
  `addtime` int(10) unsigned NOT NULL,
  `has_loan_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '已经放款金额',
  `admin_id` int(10) NOT NULL DEFAULT '0' COMMENT '申请人',
  `apply_time` int(10) NOT NULL COMMENT '申请时间',
  `loan_nums` tinyint(2) NOT NULL DEFAULT '0' COMMENT '出款次数',
  PRIMARY KEY (`loan_id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_loan_form
-- ----------------------------

-- ----------------------------
-- Table structure for gt_loan_rate
-- ----------------------------
DROP TABLE IF EXISTS `gt_loan_rate`;
CREATE TABLE `gt_loan_rate` (
  `id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `in_six_month` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '6个月之内',
  `in_year` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '1年之内',
  `in_three_year` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '3年之内',
  `in_five_year` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '5年之内',
  `other` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '超过5年',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

