-- Table structure for gt_mess_auth
-- ----------------------------
DROP TABLE IF EXISTS `gt_mess_auth`;
CREATE TABLE `gt_mess_auth` (
  `mess_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `mstatus` tinyint(2) DEFAULT NULL COMMENT '状态，与配置文件中proLevel的对应',
  `users_id` text COMMENT '可访问的用户id集合，结果是，符合条件的所有用户id放入数组中组成的json格式数据',
  PRIMARY KEY (`mess_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='消息推送权限设置';

