-- ----------------------------
-- Table structure for gt_mpay_record
-- ----------------------------
DROP TABLE IF EXISTS `gt_mpay_record`;
CREATE TABLE `gt_mpay_record` (
  `pay_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `oid` int(10) unsigned NOT NULL COMMENT '对应融资订单',
  `mid` int(10) unsigned NOT NULL COMMENT '会员id',
  `fp_id` int(10) unsigned NOT NULL COMMENT '认购项目id',
  `money` decimal(15,2) NOT NULL COMMENT '打款金额',
  `repayment_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '还款方式',
  `term` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '期限',
  `rate` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '利率',
  `add_time` int(10) unsigned NOT NULL,
  `pay_time` int(10) unsigned NOT NULL COMMENT '打款时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0未提交1已提交，待确认2已确认3还款完成',
  `remark` varchar(32) NOT NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`pay_id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;

