-- ----------------------------
-- Table structure for gt_prepare_contract
-- ----------------------------
DROP TABLE IF EXISTS `gt_prepare_contract`;
CREATE TABLE `gt_prepare_contract` (
  `pre_contract_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pro_id` int(10) unsigned NOT NULL COMMENT '项目id',
  `company_id` int(10) unsigned NOT NULL COMMENT '公司id',
  `real_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '合同签订金额',
  `term` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '保理期限单位月',
  `term_type` enum('d','m') DEFAULT 'm' COMMENT '期限类型',
  `interest_day` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '计息日',
  `cash_deposit` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '保证金%',
  `repurchase_rate` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '回购率%',
  `handling_charge` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '手续费%',
  `counseling_fee` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '咨询费%',
  `penalty_rate` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '违约金%',
  `demurrage_rate_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '二进制数',
  `demurrage_rate1` float(4,2) DEFAULT '0.00' COMMENT '贷款基准利率4倍',
  `demurrage_rate2` float(4,2) DEFAULT '0.00' COMMENT '每月利率',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0',
  `purpose` varchar(32) NOT NULL DEFAULT '' COMMENT '资金用途',
  `supervise_type` enum('gongguan','jianguan','yunzhanghu') NOT NULL DEFAULT 'gongguan' COMMENT '监管类型',
  `supervise_bank` varchar(32) NOT NULL DEFAULT '' COMMENT '监管账户银行',
  `supervise_account` varchar(32) NOT NULL DEFAULT '' COMMENT '监管账户',
  `supervise_num` varchar(20) NOT NULL DEFAULT '' COMMENT '监管账户卡号',
  `assure_kind` varchar(16) NOT NULL DEFAULT '0' COMMENT '担保方式1个人2公司',
  `assure_detail` varchar(1024) NOT NULL DEFAULT '',
  `debt_type` varchar(16) NOT NULL DEFAULT '' COMMENT '债权通知类型',
  `debt_another` varchar(32) NOT NULL DEFAULT '',
  `pro_kind` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0明保理1暗保理',
  `company_account` varchar(32) NOT NULL,
  `company_bank` varchar(32) NOT NULL,
  `company_num` varchar(32) NOT NULL,
  `pay_for_account` varchar(100) DEFAULT '0' COMMENT '未知用处',
  PRIMARY KEY (`pre_contract_id`)
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_prepare_contract
-- ----------------------------

-- ----------------------------
-- Table structure for gt_process
-- ----------------------------
DROP TABLE IF EXISTS `gt_process`;
CREATE TABLE `gt_process` (
  `id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `process_name` varchar(16) NOT NULL COMMENT '流程名称',
  `process_desc` varchar(128) NOT NULL DEFAULT '' COMMENT '流程描述',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_process
-- ----------------------------

-- ----------------------------
-- Table structure for gt_process_log
-- ----------------------------
DROP TABLE IF EXISTS `gt_process_log`;
CREATE TABLE `gt_process_log` (
  `id` mediumint(5) unsigned NOT NULL AUTO_INCREMENT,
  `context_id` int(10) unsigned NOT NULL COMMENT '总流程id',
  `admin_id` int(10) unsigned NOT NULL COMMENT '处理人',
  `step_pid` tinyint(3) unsigned NOT NULL,
  `pro_step` tinyint(2) unsigned NOT NULL COMMENT '提意见时项目属于的状态',
  `status` tinyint(1) unsigned NOT NULL COMMENT '0未通过1通过',
  `opinion` varchar(1024) NOT NULL DEFAULT '' COMMENT '意见',
  `addtime` int(10) NOT NULL,
  `context_type` varchar(16) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=907 DEFAULT CHARSET=utf8;

