-- ----------------------------
-- Table structure for gt_project
-- ----------------------------
DROP TABLE IF EXISTS `gt_project`;
CREATE TABLE `gt_project` (
  `pro_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pro_no` varchar(64) DEFAULT NULL COMMENT '项目编号',
  `pro_title` varchar(256) NOT NULL COMMENT '项目标题',
  `pro_subprocess0_desc` text COMMENT '项目简介',
  `pro_content` text COMMENT '项目内容',
  `pro_account` decimal(20,4) NOT NULL COMMENT '融资金额',
  `pro_real_money` decimal(20,4) NOT NULL DEFAULT '0.0000' COMMENT '实际借款金额',
  `step_pid` tinyint(3) NOT NULL DEFAULT '1',
  `pro_step` tinyint(3) NOT NULL DEFAULT '1' COMMENT '0:审核未通过 1:提交未处理  5项目部审核通过 8 风控部门审核通过',
  `admin_id` int(11) NOT NULL DEFAULT '0' COMMENT '项管部跟进人',
  `risk_admin_id` int(10) NOT NULL DEFAULT '0' COMMENT '风控部跟进人',
  `company_id` int(11) NOT NULL COMMENT '公司',
  `pro_linker` int(11) DEFAULT NULL COMMENT '提交人',
  `addtime` int(11) NOT NULL COMMENT '添加时间',
  `submit_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0草稿1提交',
  `role_id` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '当前状态处理角色',
  `is_loan` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否放款0未放款1放款',
  `pro_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1反向保理0正向保理',
  `backlog_id` int(10) unsigned NOT NULL DEFAULT '0',
  `after_loan_admin` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '贷后管理人员',
  `before_pro_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '已有项目id',
  `shorcut_flow` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1发起快捷流程',
  `submit_pre_contract` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否提交预签合同',
  `finish_status` text NOT NULL COMMENT '记录新建过的子流程的步骤，与config里的proLevel里的字段对应',
  `pro_subprocess4_desc` text COMMENT '子流程1备注',
  `is_all_finish` int(1) unsigned DEFAULT '0' COMMENT '是否整个项目都完成了 0是未完成 1是已完成',
  `pro_subprocess5_desc` text COMMENT '子流程2备注',
  `pro_subprocess6_desc` text,
  `pro_subprocess7_desc` text,
  `pro_subprocess8_desc` text,
  `pro_subprocess9_desc` text,
  `pro_subprocess10_desc` text,
  `pro_subprocess11_desc` text,
  `pro_subprocess12_desc` text,
  `pro_subprocess13_desc` text,
  `pro_subprocess14_desc` text,
  `pro_subprocess15_desc` text,
  `pro_subprocess16_desc` text,
  `pro_subprocess17_desc` text,
  `pro_subprocess18_desc` text,
  `binding_oa` char(20) DEFAULT NULL COMMENT '绑定OA项目的id（格式：type_id）',
  `pro_type_join_id` char(8) DEFAULT NULL COMMENT '项目类型与行业的id拼接（类型_行业）',
  `pro_subprocess20_desc` text,
  `pro_subprocess21_desc` text,
  `pro_subprocess22_desc` text,
  `pro_subprocess23_desc` text,
  `pro_subprocess24_desc` text,
  `pro_subprocess25_desc` text,
  `pro_subprocess19_desc` text,
  PRIMARY KEY (`pro_id`)
) ENGINE=InnoDB AUTO_INCREMENT=290 DEFAULT CHARSET=utf8;

-- ----------------------------
