-- ----------------------------
-- Table structure for gt_project_attachment
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_attachment`;
CREATE TABLE `gt_project_attachment` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '附件id',
  `file_id` int(10) unsigned NOT NULL COMMENT '文件夹id',
  `pro_id` int(10) unsigned NOT NULL COMMENT '项目id',
  `path` varchar(128) NOT NULL COMMENT '文件路径',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `doc_name` varchar(64) NOT NULL DEFAULT '' COMMENT '文件名',
  `admin_id` int(10) unsigned NOT NULL COMMENT '上传管理员id',
  `sha1` char(40) NOT NULL DEFAULT '' COMMENT '文件的 sha1 散列值',
  `allow_adminid` text COMMENT '可访问此文件的用户id值集合',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9843 DEFAULT CHARSET=utf8;

