  `sign_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '签收时间',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

