DROP TABLE IF EXISTS `gt_project_bill`;
CREATE TABLE `gt_project_bill` (
  `bill_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pro_id` int(10) unsigned NOT NULL DEFAULT '0',
  `addtime` int(10) DEFAULT NULL,
  `status` enum('yk','wk','wxk','wkj') NOT NULL COMMENT '状态',
  `tax_title` varchar(64) NOT NULL DEFAULT '' COMMENT '发票抬头',
  `tax_no` varchar(32) NOT NULL DEFAULT '',
  `money` decimal(15,4) NOT NULL DEFAULT '0.0000',
  `bill_type` tinyint(1) NOT NULL COMMENT '开票项目',
  `remark` varchar(64) NOT NULL DEFAULT '',
  `admin_id` int(10) unsigned NOT NULL DEFAULT '0',
  `bank_name` varchar(64) NOT NULL DEFAULT '' COMMENT '收款方银行账户',
  `bank_no` varchar(40) NOT NULL DEFAULT '' COMMENT '卡号',
  `capital_id` int(10) NOT NULL DEFAULT '0',
  `address` varchar(128) NOT NULL DEFAULT '' COMMENT '地址',
  `tel` varchar(16) NOT NULL DEFAULT '' COMMENT '电话',
  PRIMARY KEY (`bill_id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

