-- ----------------------------
-- Table structure for gt_project_contract
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_contract`;
CREATE TABLE `gt_project_contract` (
  `contract_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `contract_no` varchar(32) NOT NULL DEFAULT '' COMMENT '合同编号',
  `pro_id` int(10) unsigned NOT NULL COMMENT '项目id',
  `company_id` int(10) unsigned NOT NULL COMMENT '公司id',
  `real_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '合同签订金额',
  `term` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '保理期限',
  `term_type` enum('d','m') DEFAULT 'm' COMMENT '期限单位',
  `cash_deposit` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '保证金%',
  `repurchase_rate` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '回购率%',
  `handling_charge` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '手续费%',
  `counseling_fee` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '咨询费%',
  `penalty_rate` float(4,2) NOT NULL DEFAULT '0.00' COMMENT '违约金%',
  `demurrage_rate_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '二进制数',
  `demurrage_rate1` float(4,2) DEFAULT '0.00' COMMENT '贷款基准利率4倍',
  `demurrage_rate2` float(4,2) DEFAULT '0.00' COMMENT '每月利率',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0',
  `interest_type` enum('month','quarter','once','year','half_year','day') DEFAULT 'month' COMMENT 'month 按月 quarter按季度 one一次性付清',
  `is_day_interest` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0后置付息，1当天付一次息',
  PRIMARY KEY (`contract_id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_project_contract
-- ----------------------------

-- ----------------------------
-- Table structure for gt_project_debt
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_debt`;
CREATE TABLE `gt_project_debt` (
  `debt_all_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `company_id` int(10) unsigned NOT NULL COMMENT '公司id',
  `pro_id` int(10) unsigned NOT NULL COMMENT '项目ID',
  `contract_id` int(10) unsigned NOT NULL COMMENT '合同id',
  `admin_id` int(10) unsigned NOT NULL COMMENT '录入人的ID',
  `debt_account` decimal(20,4) unsigned NOT NULL COMMENT '债权金额',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1 正常 2已还款',
  `real_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '实际放款时间',
  `addtime` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `deadline` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '到期时间',
  `real_pay_time` int(20) unsigned NOT NULL DEFAULT '0' COMMENT '实际还款完成时间',
  `penalty` decimal(16,4) NOT NULL DEFAULT '0.0000' COMMENT '违约金',
  `demurrage` decimal(16,4) DEFAULT '0.0000' COMMENT '逾期利息',
  `begin_interest_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '第一次付息时间0是按正常付息时间',
  `pay_interest_day` varchar(2) NOT NULL DEFAULT '10' COMMENT '每月付息时间',
  `remark` varchar(128) NOT NULL DEFAULT '',
  PRIMARY KEY (`debt_all_id`)
) ENGINE=InnoDB AUTO_INCREMENT=180 DEFAULT CHARSET=utf8;

