-- ----------------------------
-- Table structure for gt_project_debt_detail
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_debt_detail`;
CREATE TABLE `gt_project_debt_detail` (
  `debt_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `debt_all_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '总债权',
  `debt_no` varchar(32) DEFAULT NULL COMMENT '债权的编号',
  `pro_id` int(10) unsigned NOT NULL COMMENT '项目ID',
  `admin_id` int(10) unsigned NOT NULL COMMENT '录入人的ID',
  `start_time` int(10) unsigned NOT NULL COMMENT '开始时间',
  `end_time` int(10) unsigned NOT NULL COMMENT '结束时间',
  `debt_value` decimal(20,4) unsigned NOT NULL COMMENT '债权金额',
  `parent_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '如果是换质，这里是置换前的债权ID',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1 正常 0作废 2已还款 ',
  `debt_repay_account` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '已还款金额',
  `debt_pay_account` decimal(20,4) unsigned NOT NULL DEFAULT '0.0000' COMMENT '公司打开给融资方多少',
  `addtime` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `remark` varchar(256) NOT NULL DEFAULT '',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '属性0正常债权1商票',
  PRIMARY KEY (`debt_id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_project_debt_detail
-- ----------------------------

-- ----------------------------
-- Table structure for gt_project_distribute
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_distribute`;
CREATE TABLE `gt_project_distribute` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pro_id` int(10) unsigned NOT NULL COMMENT '项目id',
  `admin_id` int(10) unsigned NOT NULL COMMENT '管理员id',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0交接1处理中',
  `addtime` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_project_distribute
-- ----------------------------

