  `type` enum('cash_deposit','counseling_fee','handling_charge') NOT NULL COMMENT '类型',
  `money` decimal(15,4) unsigned NOT NULL,
  `has_repay_money` decimal(15,4) unsigned NOT NULL DEFAULT '0.0000',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `addtime` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8;

