-- ----------------------------
-- Table structure for gt_project_file
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_file`;
CREATE TABLE `gt_project_file` (
  `file_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pro_id` int(10) NOT NULL COMMENT '项目id',
  `pid` int(10) unsigned NOT NULL COMMENT '父文件夹',
  `is_file` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否为文件夹',
  `is_document` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否为文件',
  `file_name` varchar(32) NOT NULL DEFAULT '' COMMENT '文件夹/文件名称',
  `short_name` varchar(16) NOT NULL DEFAULT '' COMMENT '文件夹简写，使用拼音',
  `is_auth` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0不需要认证，1需要认证',
  `secret` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1:普通文件，2:项管部专用文件',
  `allow_adminid` text COMMENT '被特殊允许可以查看此文件的人的id号，\r\n以逗号隔离开来',
  PRIMARY KEY (`file_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3152 DEFAULT CHARSET=utf8;

