-- ----------------------------
-- Table structure for gt_project_finish
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_finish`;
CREATE TABLE `gt_project_finish` (
  `finish_id` tinyint(10) unsigned NOT NULL AUTO_INCREMENT,
  `pro_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '项目id',
  `pro_time_limit` varchar(32) NOT NULL DEFAULT '' COMMENT '期限',
  `back_ukey` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '退回ukey',
  `back_ukey_detail` varchar(1024) NOT NULL DEFAULT '' COMMENT '退回说明',
  `back_invoice` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '发票',
  `logout_zdw` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1需要注销中登网',
  `logout_account` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '注销账户',
  `change_yz` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '更改印章',
  `other` varchar(1024) NOT NULL DEFAULT '' COMMENT '其他',
  `content` varchar(1024) NOT NULL DEFAULT '' COMMENT '项目说明',
  `admin_id` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '申请人',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '申请时间',
  `close_off` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否结清',
  `close_off_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '结清时间',
  `submit_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否提交',
  `archived_admin` mediumint(5) unsigned NOT NULL DEFAULT '0',
  `archived_time` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`finish_id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

