-- ----------------------------
-- Table structure for gt_project_note
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_note`;
CREATE TABLE `gt_project_note` (
  `note_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pro_id` int(10) unsigned NOT NULL COMMENT '项目ID',
  `gt_uid` int(10) unsigned NOT NULL COMMENT '国投用户ID',
  `note_desc` text COMMENT '意见',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '2' COMMENT '状态 2正常',
  `pro_status` tinyint(1) DEFAULT NULL COMMENT '提意见时项目属于的状态',
  `note_agree` tinyint(1) NOT NULL DEFAULT '0' COMMENT '通过与否',
  `addtime` int(11) DEFAULT NULL,
  PRIMARY KEY (`note_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_project_note
-- ----------------------------

-- ----------------------------
-- Table structure for gt_project_repayment
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_repayment`;
CREATE TABLE `gt_project_repayment` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `rp_id` int(10) unsigned NOT NULL DEFAULT '0',
  `debt_all_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '会员单位id',
  `repay_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '实际还款金额',
  `real_repay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '实际还款时间',
  `repay_pic` varchar(64) NOT NULL DEFAULT '' COMMENT '打款凭证',
  `type` enum('cash_deposit','counseling_fee','handling_charge','interest','principal','back_cash_deposit','back_interest','back_handling_charge','back_other') DEFAULT NULL,
  `addtime` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=142 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_project_repayment
-- ----------------------------

-- ----------------------------
-- Table structure for gt_project_repayment_schedule
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_repayment_schedule`;
CREATE TABLE `gt_project_repayment_schedule` (
  `rp_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `debt_all_id` int(10) unsigned NOT NULL COMMENT '对应债权id',
  `pro_id` int(10) unsigned NOT NULL COMMENT '项目id',
  `company_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '供应商id',
  `principal` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '本金',
  `interest` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '利息',
  `surplus_principal` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '剩余本金',
  `penalty` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '违约金',
  `demurrage` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '逾期利息',
  `term_rate` decimal(5,2) NOT NULL DEFAULT '0.00' COMMENT '每期利率',
  `n_term` tinyint(3) unsigned NOT NULL COMMENT '第N期数',
  `term` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '总期限',
  `repay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '还款时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否还款0未还1已还',
  `last_repay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最近一次还款时间',
  `has_repay_money` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '实际还款金额',
  `demurrage_days` mediumint(5) unsigned NOT NULL DEFAULT '0' COMMENT '逾期天数',
  `type` enum('interest','principal') NOT NULL DEFAULT 'interest',
  PRIMARY KEY (`rp_id`)
) ENGINE=InnoDB AUTO_INCREMENT=767 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of gt_project_repayment_schedule
-- ----------------------------

-- ----------------------------
-- Table structure for gt_project_review
-- ----------------------------
DROP TABLE IF EXISTS `gt_project_review`;
CREATE TABLE `gt_project_review` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '附件id',
  `log_id` int(10) unsigned NOT NULL COMMENT '流程日志id',
  `pro_id` int(10) unsigned NOT NULL COMMENT '项目id',
  `path` varchar(128) NOT NULL COMMENT '文件路径',
  `addtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `doc_name` varchar(64) NOT NULL DEFAULT '' COMMENT '文件名',
  `admin_id` int(10) unsigned NOT NULL COMMENT '上传管理员id',
  `sha1` char(40) NOT NULL DEFAULT '' COMMENT '文件的 sha1 散列值',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=utf8;

