DROP TABLE IF EXISTS `gt_repayment_schedule`;
CREATE TABLE `gt_repayment_schedule` (
  `rp_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `oid` int(10) unsigned NOT NULL COMMENT '对应认购记录',
  `fp_id` int(10) unsigned NOT NULL COMMENT '融资项目id',
  `mpay_id` int(10) unsigned NOT NULL COMMENT '会员单位打款id',
  `mid` int(10) unsigned NOT NULL COMMENT '会员id',
  `principal` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '本金',
  `interest` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '利息',
  `term_rate` decimal(5,2) NOT NULL DEFAULT '0.00' COMMENT '每期利率',
  `n_term` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '第N期数',
  `repay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '还款时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否还款',
  `last_repay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最近一次还款时间',
  `has_repay_money` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '实际还款金额',
  PRIMARY KEY (`rp_id`)
) ENGINE=InnoDB AUTO_INCREMENT=180 DEFAULT CHARSET=utf8;

