-- ----------------------------
-- Table structure for gt_request_apply
-- ----------------------------
DROP TABLE IF EXISTS `gt_request_apply`;
CREATE TABLE `gt_request_apply` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(150) NOT NULL COMMENT '申请人',
  `applicant` char(12) NOT NULL COMMENT '申请部门',
  `addtime` int(11) NOT NULL COMMENT '申请时间',
  `product_name` varchar(100) NOT NULL COMMENT '产品名称',
  `contract_num` varchar(100) DEFAULT NULL COMMENT '合同编号',
  `full_scale_time` int(11) NOT NULL COMMENT '满标时间',
  `collect_money` float(14,0) NOT NULL COMMENT '募集额度，也称为融资额度,单位，元',
  `loan_money` float(14,0) DEFAULT NULL COMMENT '放款额度,单位，元',
  `limit_time` int(4) DEFAULT NULL COMMENT '融资期限',
  `time_type` tinyint(2) DEFAULT NULL COMMENT '项目期限类型，1：天，2：月',
  `trade_type` tinyint(1) DEFAULT '4' COMMENT '融资方 ，1:个人，2：企业，3：金融资产交易所，4：保理机构，5：其它',
  `pay_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '支付方式，1：网银，2：现金，3：银行汇款，4：其它',
  `supervise` tinyint(1) NOT NULL DEFAULT '2' COMMENT '监管账户，1：是，2：否',
  `account_name` varchar(30) NOT NULL COMMENT '账户名称',
  `bank_name` varchar(30) NOT NULL COMMENT '银行卡名称',
  `bank_num` varchar(30) NOT NULL COMMENT '银行卡账号',
  `account` int(10) DEFAULT NULL COMMENT '账号',
  `charge_money` float(10,0) DEFAULT NULL COMMENT '居间服务费的融资金额,单位元',
  `charge_rate` float(6,0) DEFAULT NULL COMMENT '居间服务费率',
  `product_type` tinyint(2) DEFAULT NULL COMMENT '项目类型',
  `otherinfo` varchar(256) DEFAULT NULL COMMENT '其它信息，json格式',
  `bail_status` tinyint(1) DEFAULT NULL COMMENT '保证金是否已付，1，已付，2，未付',
  `warrant_company` varchar(30) DEFAULT NULL COMMENT '担保企业',
  `bid` int(10) DEFAULT NULL COMMENT '第三方数据库的id',
  `status` int(1) DEFAULT '0' COMMENT '0是未开始审核，1是审核中，2是已经全部审核完成',
  `charge_account_name` varchar(30) DEFAULT NULL COMMENT '居间费户名',
  `charge_bank_name` varchar(30) DEFAULT NULL COMMENT '居间费开户银行',
  `charge_bank_num` varchar(30) DEFAULT NULL COMMENT '居间费账号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COMMENT='请款审批书';

-- ----------------------------
-- Records of gt_request_apply
-- ----------------------------

