DROP TABLE IF EXISTS `gt_request_checkinfo`;
CREATE TABLE `gt_request_checkinfo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '审核人id',
  `grf_id` int(11) NOT NULL COMMENT 'gt_request_found表id',
  `checkinfo` text COMMENT '审核意见',
  `addtime` int(11) NOT NULL COMMENT '审核通过添加时间',
  `chresult` enum('1','2','3') NOT NULL DEFAULT '1' COMMENT '审核的结果,1,未审核，2，审核通过，3，审核未通过',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=50 DEFAULT CHARSET=utf8 COMMENT='质换审核详细信息表';

