-- ----------------------------
-- Table structure for gt_request_found
-- ----------------------------
DROP TABLE IF EXISTS `gt_request_found`;
CREATE TABLE `gt_request_found` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '申请人id号',
  `project_id` int(11) DEFAULT NULL COMMENT '项目id',
  `guarantee_way` varchar(16) DEFAULT NULL COMMENT '担保方式 ，其中:  1-个人担保，2-企业担保 ,3-应收账款质押，4-房屋抵押，5-机械设备抵押，6-股权质押，7-货权凭证，8-其它',
  `pay_way` enum('4','3','2','1') NOT NULL DEFAULT '1' COMMENT '支付方式：  1-网银 ， 2-现金  ，  3-银行汇款  ，  4- 其它',
  `project_con` varchar(25) DEFAULT NULL COMMENT '项目编号',
  `addtime` int(11) NOT NULL,
  `starttime` int(11) NOT NULL COMMENT '融资开始时间',
  `endtime` int(11) NOT NULL COMMENT '融资结束时间',
  `sdetail` text NOT NULL COMMENT '收款鸣谢， 此处为一个json数据。\r\n\r\nstatus : 是否监管账户 , 1-是  ~  0-否\r\nmoney : 收款 金额 \r\ncmoney:人民币大写\r\ncname : 户名\r\nbname :开户行 \r\naccount : 账户\r\n\r\n',
  `qdetail` text COMMENT '请款金额，此处为一个json数据格式。\r\n\r\nstatus  :  是否监管账户，1是，0 否\r\nrmoney: 融资金额\r\ntmoney ：  退款金额\r\ncrmoney :融资金额人民币大写\r\nctmoney : 退款金额人民币大写\r\ncname: 户名\r\nbname: 开户行\r\naccount :  账号\r\n\r\n',
  `zdetail` text COMMENT '换质情况 , 此处为一个json数据格式:\r\n\r\nebondmoney: 到期债权金额\r\nebondtime :  到期债权有效期限\r\ncbondmoney : 换质债权金额\r\ncbondtime : 质换债权期限',
  `step` tinyint(1) DEFAULT '1' COMMENT '审核进程 : \r\n\r\n1.  申请人签名\r\n\r\n2.法务负责人签名\r\n3.货后风险控制人签名\r\n4.货中审核人签名\r\n\r\n5.风控总监签名\r\n6.副总裁签名\r\n7.总裁签名\r\n8.出纳签名\r\n9.财务部负责人签名\r\n',
  `status` enum('1','2','3','4') NOT NULL DEFAULT '1' COMMENT '是否全部审核通过 , 1，已提交，2，审核中,3,审核通过4，驳回',
  `othersinfo` text COMMENT '其它情况说明',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='换置请款相关信息表';

-- ----------------------------
-- Records of gt_request_found
-- ----------------------------

