CREATE TABLE `gt_research_report` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `path` varchar(128) NOT NULL DEFAULT '',
  `filename` varchar(128) NOT NULL DEFAULT '' COMMENT '文件名',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0',
  `admin_id` mediumint(5) unsigned NOT NULL DEFAULT '0' COMMENT '上传人员id',
  `description` varchar(1024) NOT NULL DEFAULT '' COMMENT '描述',
  `author` varchar(32) NOT NULL DEFAULT '' COMMENT '作者',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0不可见，1可见',
  `dept_id` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '部门id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

