-- ----------------------------
DROP TABLE IF EXISTS `gt_workflow`;
CREATE TABLE `gt_workflow` (
  `flow_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `step_pid` tinyint(1) DEFAULT NULL,
  `step_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `title` varchar(32) NOT NULL DEFAULT '' COMMENT '流程名称',
  `step_desc` varchar(32) NOT NULL DEFAULT '' COMMENT '流程描述',
  `step_next` varchar(256) NOT NULL DEFAULT '' COMMENT 'json格式',
  `is_over` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否是流程终结',
  `dp_id` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '部门id',
  `is_audit` tinyint(1) NOT NULL DEFAULT '1',
  `is_auto` tinyint(1) NOT NULL DEFAULT '1',
  `step_role_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '关联角色',
  `is_role` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0不发给角色1发给角色',
  PRIMARY KEY (`flow_id`)
) ENGINE=MyISAM AUTO_INCREMENT=45 DEFAULT CHARSET=utf8;

