DROP TABLE IF EXISTS `gt_workflow_node`;
CREATE TABLE `gt_workflow_node` (
  `node_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `type_id` tinyint(3) unsigned NOT NULL COMMENT '流程id',
  `node_index` tinyint(3) unsigned NOT NULL COMMENT '节点序号',
  `node_name` varchar(32) NOT NULL DEFAULT '' COMMENT '节点描述',
  `node_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '1人为决策，2自动处理(直接执行execute_function)，3等待外部响应(例如外部WS触发),4分支，5汇总 6结束结点（此结点执行时候自动终止进程）',
  `prev_node_index` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `next_node_index` varchar(256) NOT NULL DEFAULT '',
  `execute_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '0需所有人执行（会审） 1只需一人执行',
  PRIMARY KEY (`node_id`)
) ENGINE=InnoDB AUTO_INCREMENT=200 DEFAULT CHARSET=utf8;

