-- ----------------------------
-- Table structure for gt_workflow_process
-- ----------------------------
DROP TABLE IF EXISTS `gt_workflow_process`;
CREATE TABLE `gt_workflow_process` (
  `process_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '进程id',
  `workflow_id` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '流程id',
  `process_desc` varchar(32) NOT NULL DEFAULT '' COMMENT '进程描述',
  `context` varchar(16) NOT NULL DEFAULT '0' COMMENT '\r\n\r\n存放上下文变量,例如业务表的id',
  `current_node_index` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '当前结点序号',
  `start_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '流程启动时间',
  `finish_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '流程完成时间',
  `state` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态',
  `start_user` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发起人',
  `admin_id` int(10) NOT NULL DEFAULT '0',
  `role_id` tinyint(3) NOT NULL DEFAULT '0',
  `dp_id` tinyint(3) NOT NULL DEFAULT '0',
  `context_type` varchar(16) NOT NULL DEFAULT '' COMMENT '\r\n\r\n存放上下文变量,例如业务表的字段',
  PRIMARY KEY (`process_id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8;

